export default function Die(props) {
    return (
      <div
        className="die"
        style={{
            height: '50px',
            width: '50px',
            backgroundColor: 'white',
            borderRadius: '5px',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            boxShadow: '0px 2px 2px whitesmoke',
            marginTop: 'auto',
            marginBottom: 'auto'
        }}
      >
        <h2>{props.value}</h2>
      </div>
    );
};
